"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[574],{8574:function(t){t.exports=JSON.parse('{"meta":{"title":"75\xb0C \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f ({fahrenheit}\xb0F) | \u0930\u0942\u092a\u093e\u0902\u0924\u0930\u0923 \u0917\u093e\u0907\u0921 \u0914\u0930 \u091a\u093e\u0930\u094d\u091f","description":"75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0915\u094b \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u092e\u0947\u0902 \u0924\u0941\u0930\u0902\u0924 \u092c\u0926\u0932\u0947\u0902\u0964 \u091c\u093e\u0928\u0947\u0902 \u0915\u093f 75\xb0C = {fahrenheit}\xb0F, \u0938\u091f\u0940\u0915 \u0938\u0942\u0924\u094d\u0930, \u091a\u0930\u0923-\u0926\u0930-\u091a\u0930\u0923 \u0917\u0923\u0928\u093e \u0914\u0930 \u0913\u0935\u0928, \u092c\u0947\u0915\u093f\u0902\u0917 \u0914\u0930 \u0916\u093e\u0926\u094d\u092f \u0938\u0941\u0930\u0915\u094d\u0937\u093e \u092e\u0947\u0902 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u0909\u092a\u092f\u094b\u0917 \u0926\u0947\u0916\u0947\u0902\u0964","ogTitle":"75\xb0C \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f ({fahrenheit}\xb0F) \u0915\u0928\u0935\u0930\u094d\u091f\u0930 \u0914\u0930 \u0917\u093e\u0907\u0921","ogDescription":"\u0924\u0941\u0930\u0902\u0924 75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0915\u094b \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u092e\u0947\u0902 \u092c\u0926\u0932\u0947\u0902\u0964 75\xb0C = {fahrenheit}\xb0F\u0964 \u0907\u0938\u092e\u0947\u0902 \u0913\u0935\u0928 \u0938\u0947\u091f\u093f\u0902\u0917\u094d\u0938, \u092a\u093e\u0928\u0940 \u0915\u093e \u0924\u093e\u092a\u092e\u093e\u0928 \u0914\u0930 \u0924\u094d\u0935\u0930\u093f\u0924 \u0930\u0942\u092a\u093e\u0902\u0924\u0930\u0923 \u091a\u093e\u0930\u094d\u091f \u0936\u093e\u092e\u093f\u0932 \u0939\u0948\u0964"},"page":{"title":"75\xb0C \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f ({fahrenheit}\xb0F) - \u092a\u0942\u0930\u094d\u0923 \u0930\u0942\u092a\u093e\u0902\u0924\u0930\u0923 \u0917\u093e\u0907\u0921","description":"<strong>75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0915\u094b \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u092e\u0947\u0902 \u0924\u0941\u0930\u0902\u0924 \u092c\u0926\u0932\u0947\u0902</strong>\u0964 <strong>75\xb0C = {fahrenheit}\xb0F</strong>. \u091a\u093e\u0939\u0947 \u0906\u092a \u0913\u0935\u0928 \u0938\u0947\u091f\u093f\u0902\u0917\u094d\u0938 \u0915\u0947 \u0932\u093f\u090f <strong>75 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f</strong> \u0915\u0940 \u091c\u093e\u0902\u091a \u0915\u0930 \u0930\u0939\u0947 \u0939\u094b\u0902, \u0914\u0926\u094d\u092f\u094b\u0917\u093f\u0915 \u0938\u0941\u0916\u093e\u0928\u0947, \u092f\u093e \u0935\u0948\u091c\u094d\u091e\u093e\u0928\u093f\u0915 \u0905\u0928\u0941\u0938\u0902\u0927\u093e\u0928 \u0915\u0947 \u0932\u093f\u090f, \u092f\u0939 \u0917\u093e\u0907\u0921 \u0938\u091f\u0940\u0915 \u0917\u0923\u093f\u0924 \u0914\u0930 \u0938\u0902\u0926\u0930\u094d\u092d \u092a\u094d\u0930\u0926\u093e\u0928 \u0915\u0930\u0924\u0940 \u0939\u0948\u0964 \u0907\u0938 \u0909\u091a\u094d\u091a \u0924\u093e\u092a\u092e\u093e\u0928 \u0915\u094b \u0938\u092e\u091d\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0939\u092e\u093e\u0930\u0947 <strong>75 C \u0938\u0947 F \u091a\u093e\u0930\u094d\u091f</strong> \u0914\u0930 \u0938\u0942\u0924\u094d\u0930 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0947\u0902\u0964","resultText":"\u092a\u091a\u0939\u0924\u094d\u0924\u0930 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u092c\u0930\u093e\u092c\u0930 {fahrenheit} \u0921\u093f\u0917\u094d\u0930\u0940 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f"},"warning":{"title":"\u26a0\ufe0f \u0938\u0941\u0930\u0915\u094d\u0937\u093e \u091a\u0947\u0924\u093e\u0935\u0928\u0940: 75\xb0C ({fahrenheit}\xb0F) \u092c\u0939\u0941\u0924 \u0917\u0930\u094d\u092e \u0939\u0948","content":"<strong>75\xb0C \u0924\u093e\u092a\u092e\u093e\u0928 \u0915\u0947 \u0938\u093e\u0925 \u0905\u0924\u094d\u092f\u0927\u093f\u0915 \u0938\u093e\u0935\u0927\u093e\u0928\u0940 \u092c\u0930\u0924\u0947\u0902</strong>\u0964 \u092f\u0939 \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937 \u092e\u093e\u0928\u0935 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0947 \u0932\u093f\u090f \u0916\u0924\u0930\u0928\u093e\u0915 \u0930\u0942\u092a \u0938\u0947 \u0917\u0930\u094d\u092e \u0939\u0948 \u0914\u0930 \u0917\u0902\u092d\u0940\u0930 \u091c\u0932\u0928 \u092a\u0948\u0926\u093e \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u092f\u0939 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u0936\u0930\u0940\u0930 \u0915\u0947 \u0924\u093e\u092a\u092e\u093e\u0928 (37\xb0C) \u0938\u0947 \u0915\u093e\u092b\u0940 \u0917\u0930\u094d\u092e \u0939\u0948\u0964 75\xb0C \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0905\u0915\u094d\u0938\u0930 <strong>\u092a\u0902\u0916\u0947 \u0935\u093e\u0932\u0947 \u0913\u0935\u0928</strong> \u0914\u0930 \u0914\u0926\u094d\u092f\u094b\u0917\u093f\u0915 \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902 \u092e\u0947\u0902 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u0907\u0938\u0932\u093f\u090f \u0939\u092e\u0947\u0936\u093e \u0909\u091a\u093f\u0924 \u0938\u0941\u0930\u0915\u094d\u0937\u093e\u0924\u094d\u092e\u0915 \u0909\u092a\u0915\u0930\u0923\u094b\u0902 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0947\u0902\u0964"},"context":{"oven":{"title":"\ud83c\udf73 \u092c\u0947\u0915\u093f\u0902\u0917 \u0914\u0930 \u0913\u0935\u0928 \u0938\u0947\u091f\u093f\u0902\u0917\u094d\u0938 (75\xb0C / {fahrenheit}\xb0F)","content":"\u0916\u093e\u0928\u093e \u092a\u0915\u093e\u0928\u0947 \u092e\u0947\u0902, 75\xb0C ({fahrenheit}\xb0F) \u090f\u0915 \u0935\u093f\u0936\u093f\u0937\u094d\u091f \u0924\u093e\u092a\u092e\u093e\u0928 \u0939\u0948\u0964 \u091c\u092c\u0915\u093f \u092e\u093e\u0928\u0915 \u092c\u0947\u0915\u093f\u0902\u0917 \u0905\u0915\u094d\u0938\u0930 150\xb0C \u0938\u0947 \u0936\u0941\u0930\u0942 \u0939\u094b\u0924\u0940 \u0939\u0948, \u0913\u0935\u0928 \u092e\u0947\u0902 <strong>75 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938</strong> \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u092e \u0924\u093e\u092a\u092e\u093e\u0928 \u0935\u093e\u0932\u0940 \u0938\u0941\u0916\u093e\u0928\u0947, \u0917\u0930\u094d\u092e \u0915\u0930\u0928\u0947, \u092f\u093e \u092b\u0932\u094b\u0902 \u0914\u0930 \u091d\u091f\u0915\u0947\u0926\u093e\u0930 \u092e\u093e\u0902\u0938 \u0915\u094b \u0927\u0940\u0930\u0947-\u0927\u0940\u0930\u0947 \u0928\u093f\u0930\u094d\u091c\u0932\u093f\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964","items":["\u092a\u094d\u0932\u0947\u091f\u094b\u0902 \u0914\u0930 \u092d\u094b\u091c\u0928 \u0915\u094b \u0927\u0940\u0930\u0947 \u0938\u0947 \u0917\u0930\u094d\u092e \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0909\u092a\u092f\u0941\u0915\u094d\u0924","\u092b\u0932\u094b\u0902 \u0914\u0930 \u0938\u092c\u094d\u091c\u093f\u092f\u094b\u0902 \u0915\u094b \u0928\u093f\u0930\u094d\u091c\u0932\u093f\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0909\u092a\u092f\u094b\u0917 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948","\u091c\u0921\u093c\u0940-\u092c\u0942\u091f\u093f\u092f\u094b\u0902 \u0914\u0930 \u092b\u0942\u0932\u094b\u0902 \u0915\u094b \u0927\u0940\u0930\u0947-\u0927\u0940\u0930\u0947 \u0938\u0941\u0916\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0906\u0926\u0930\u094d\u0936","\u0915\u092d\u0940-\u0915\u092d\u0940 \u0916\u093e\u0928\u093e \u092a\u0915\u093e\u0928\u0947 \u0915\u0947 \u092c\u093e\u0926 \u092e\u093e\u0902\u0938 \u0915\u094b \u0938\u0941\u0930\u0915\u094d\u0937\u093f\u0924 \u0924\u093e\u092a\u092e\u093e\u0928 \u092a\u0930 \u0930\u0916\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0909\u092a\u092f\u094b\u0917 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948"]},"industrial":{"title":"\ud83c\udfed \u0935\u093f\u091c\u094d\u091e\u093e\u0928 \u0914\u0930 \u0914\u0926\u094d\u092f\u094b\u0917\u093f\u0915 (\u0915\u0947\u0932\u094d\u0935\u093f\u0928 \u0914\u0930 \u092a\u093e\u0928\u0940)","content":"75\xb0C \u090a\u0937\u094d\u092e\u092a\u094d\u0930\u0935\u0948\u0917\u093f\u0915\u0940 \u092e\u0947\u0902 \u090f\u0915 \u092e\u0939\u0924\u094d\u0935\u092a\u0942\u0930\u094d\u0923 \u092e\u0940\u0932 \u0915\u093e \u092a\u0924\u094d\u0925\u0930 \u0939\u0948\u0964 <strong>75 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0938\u0947 \u0915\u0947\u0932\u094d\u0935\u093f\u0928</strong> \u0915\u0947 \u0938\u0902\u0926\u0930\u094d\u092d \u092e\u0947\u0902, \u092f\u0939 348.15 K \u0915\u0947 \u092c\u0930\u093e\u092c\u0930 \u0939\u0948\u0964 75\xb0C \u0915\u093e \u092a\u093e\u0928\u0940 \u0905\u0924\u094d\u092f\u0927\u093f\u0915 \u0917\u0930\u094d\u092e \u0939\u094b\u0924\u093e \u0939\u0948 \u0914\u0930 \u0907\u0938\u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0914\u0926\u094d\u092f\u094b\u0917\u093f\u0915 \u0938\u092b\u093e\u0908 \u0914\u0930 \u0928\u0938\u092c\u0902\u0926\u0940 \u092e\u0947\u0902 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964","items":["75\xb0C = 348.15 \u0915\u0947\u0932\u094d\u0935\u093f\u0928","\u0917\u0930\u094d\u092e \u092a\u093e\u0928\u0940 \u0928\u0938\u092c\u0902\u0926\u0940 \u0932\u0942\u092a \u092e\u0947\u0902 \u092a\u094d\u0930\u092f\u0941\u0915\u094d\u0924","\u0914\u0926\u094d\u092f\u094b\u0917\u093f\u0915 \u0930\u093e\u0938\u093e\u092f\u0928\u093f\u0915 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902 \u0915\u0947 \u0932\u093f\u090f \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u0924\u093e\u092a\u092e\u093e\u0928","\u0938\u0941\u0916\u093e\u0928\u0947 \u0915\u0940 \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902 \u0915\u0947 \u0932\u093f\u090f \u092e\u0939\u0924\u094d\u0935\u092a\u0942\u0930\u094d\u0923 \u0924\u093e\u092a\u0940\u092f \u090a\u0930\u094d\u091c\u093e"]},"safety":{"title":"\u26a0\ufe0f \u092c\u0941\u0916\u093e\u0930 \u092c\u0928\u093e\u092e \u091d\u0941\u0932\u0938\u0928\u093e (75\xb0C \u091a\u0947\u0924\u093e\u0935\u0928\u0940)","content":"\u092c\u0941\u0916\u093e\u0930 \u0915\u0947 \u0932\u093f\u090f <strong>75 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f</strong> \u0916\u094b\u091c \u0930\u0939\u0947 \u0939\u0948\u0902? \u092f\u0939 \u091c\u093e\u0928\u0928\u093e \u092e\u0939\u0924\u094d\u0935\u092a\u0942\u0930\u094d\u0923 \u0939\u0948 \u0915\u093f 75\xb0C <strong>\u092c\u0941\u0916\u093e\u0930 \u0928\u0939\u0940\u0902 \u0939\u0948</strong>\u2014\u092f\u0939 167\xb0F \u0939\u0948, \u091c\u094b \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902 \u0915\u0947 \u0932\u093f\u090f \u0918\u093e\u0924\u0915 \u0939\u0948\u0964 \u0924\u0947\u091c\u093c \u092c\u0941\u0916\u093e\u0930 \u0932\u0917\u092d\u0917 40\xb0C (104\xb0F) \u0939\u094b\u0924\u093e \u0939\u0948\u0964 75\xb0C \u0915\u093e \u092a\u093e\u0928\u0940 \u0924\u0941\u0930\u0902\u0924 \u0924\u0940\u0938\u0930\u0940 \u0921\u093f\u0917\u094d\u0930\u0940 \u0915\u0940 \u091c\u0932\u0928 \u092a\u0948\u0926\u093e \u0915\u0930\u0947\u0917\u093e\u0964","items":["75\xb0C = 167\xb0F (\u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902 \u0915\u0947 \u0932\u093f\u090f \u0918\u093e\u0924\u0915/\u0916\u0924\u0930\u0928\u093e\u0915)","75\xb0C \u0915\u093e \u092a\u093e\u0928\u0940 \u0924\u0941\u0930\u0902\u0924 \u091d\u0941\u0932\u0938\u0928\u0947 \u0915\u093e \u0915\u093e\u0930\u0923 \u092c\u0928\u0924\u093e \u0939\u0948","\u0930\u093f\u0915\u0949\u0930\u094d\u0921 \u0915\u093f\u090f \u0917\u090f \u0909\u091a\u094d\u091a\u0924\u092e \u092e\u093e\u0928\u0935 \u092c\u0941\u0916\u093e\u0930 \u0938\u0947 \u092c\u0939\u0941\u0924 \u0905\u0927\u093f\u0915","\u0914\u0926\u094d\u092f\u094b\u0917\u093f\u0915 \u0938\u0941\u0930\u0915\u094d\u0937\u093e \u092a\u094d\u0930\u094b\u091f\u094b\u0915\u0949\u0932 \u0915\u0940 \u0906\u0935\u0936\u094d\u092f\u0915\u0924\u093e \u0939\u0948"]}},"negative":{"result":"-75\xb0C \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u091a\u093e\u0930\u094d\u091f","description":"\u092e\u093e\u0907\u0928\u0938 75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u092c\u0930\u093e\u092c\u0930 <strong>{negativeFahrenheit} \u0921\u093f\u0917\u094d\u0930\u0940 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f</strong>\u0964 \u092f\u0939 \u0905\u0924\u094d\u092f\u0927\u093f\u0915 \u0920\u0902\u0921\u093e \u0939\u0948, \u0921\u094d\u0930\u093e\u0908 \u0906\u0907\u0938 \u0915\u0947 \u0924\u093e\u092a\u092e\u093e\u0928 \u092f\u093e \u0905\u0902\u091f\u093e\u0930\u094d\u0915\u091f\u093f\u0915 \u0938\u0930\u094d\u0926\u093f\u092f\u094b\u0902 \u0915\u0947 \u0938\u092e\u093e\u0928\u0964"},"faq":{"items":[{"question":"\u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u092e\u0947\u0902 75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0915\u093f\u0924\u0928\u093e \u0939\u094b\u0924\u093e \u0939\u0948 (75 C to F)?","answer":"75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 <strong>{fahrenheit} \u0921\u093f\u0917\u094d\u0930\u0940 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f</strong> ({fahrenheit}\xb0F) \u0915\u0947 \u092c\u0930\u093e\u092c\u0930 \u0939\u0948\u0964 \u0938\u0942\u0924\u094d\u0930 \u0939\u0948: \xb0F = (75 \xd7 9/5) + 32."},{"question":"\u092e\u0948\u0902 75 F \u0915\u094b C \u092e\u0947\u0902 \u0915\u0948\u0938\u0947 \u092c\u0926\u0932\u0942\u0902?","answer":"<strong>75 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u0915\u094b \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938</strong> \u092e\u0947\u0902 \u092c\u0926\u0932\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, 32 \u0918\u091f\u093e\u090f\u0902 \u0914\u0930 5/9 \u0938\u0947 \u0917\u0941\u0923\u093e \u0915\u0930\u0947\u0902\u0964 75\xb0F \u0932\u0917\u092d\u0917 <strong>23.9\xb0C</strong> \u0915\u0947 \u092c\u0930\u093e\u092c\u0930 \u0939\u0948, \u091c\u094b \u090f\u0915 \u0906\u0930\u093e\u092e\u0926\u093e\u092f\u0915 \u0915\u092e\u0930\u0947 \u0915\u093e \u0924\u093e\u092a\u092e\u093e\u0928 \u0939\u0948\u0964"},{"question":"\u0915\u0947\u0932\u094d\u0935\u093f\u0928 \u092e\u0947\u0902 75 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0915\u094d\u092f\u093e \u0939\u0948 (75 C to K)?","answer":"\u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0915\u094b \u0915\u0947\u0932\u094d\u0935\u093f\u0928 \u092e\u0947\u0902 \u092c\u0926\u0932\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, 273.15 \u091c\u094b\u0921\u093c\u0947\u0902\u0964 75\xb0C <strong>348.15 \u0915\u0947\u0932\u094d\u0935\u093f\u0928</strong> \u0939\u0948\u0964"},{"question":"\u0915\u094d\u092f\u093e \u091c\u0932 \u0915\u0947 \u0932\u093f\u090f 75 \u0921\u093f\u0917\u094d\u0930\u0940 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0917\u0930\u094d\u092e \u0939\u0948?","answer":"\u0939\u093e\u0901, 75\xb0C \u0915\u093e \u092a\u093e\u0928\u0940 <strong>\u0916\u0924\u0930\u0928\u093e\u0915 \u0930\u0942\u092a \u0938\u0947 \u0917\u0930\u094d\u092e</strong> \u0939\u0948\u0964 \u092f\u0939 \u0928\u0932 \u0915\u0947 \u092a\u093e\u0928\u0940 \u0915\u0940 \u0938\u0941\u0930\u0915\u094d\u0937\u093f\u0924 \u0938\u0940\u092e\u093e (\u0906\u092e\u0924\u094c\u0930 \u092a\u0930 49\xb0C/120\xb0F) \u0938\u0947 \u0915\u093e\u092b\u0940 \u0905\u0927\u093f\u0915 \u0917\u0930\u094d\u092e \u0939\u0948 \u0914\u0930 \u0915\u094d\u0935\u0925\u0928\u093e\u0902\u0915 (100\xb0C) \u0915\u0947 \u0915\u0930\u0940\u092c \u0939\u0948\u0964"},{"question":"\u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u092e\u0947\u0902 70 \u0938\u0947 75 \u0921\u093f\u0917\u094d\u0930\u0940 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u0915\u093f\u0924\u0928\u093e \u0939\u0948?","answer":"<strong>70\xb0F \u0938\u0947 75\xb0F</strong> \u0915\u0940 \u0938\u0940\u092e\u093e <strong>21.1\xb0C \u0938\u0947 23.9\xb0C</strong> \u0915\u0947 \u0905\u0928\u0941\u0930\u0942\u092a \u0939\u0948\u0964 \u092f\u0939 \u0906\u0930\u093e\u092e\u0926\u093e\u092f\u0915 \u0907\u0928\u0921\u094b\u0930 \u0935\u093e\u0924\u093e\u0935\u0930\u0923 \u0915\u0947 \u0932\u093f\u090f \u0906\u0926\u0930\u094d\u0936 \u0938\u0940\u092e\u093e \u0939\u0948\u0964"},{"question":"75 \u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0938\u0947 \u092b\u093c\u093e\u0930\u0947\u0928\u0939\u093e\u0907\u091f \u0915\u093e \u0938\u0942\u0924\u094d\u0930 \u0915\u094d\u092f\u093e \u0939\u0948?","answer":"\u0938\u0947\u0932\u094d\u0938\u093f\u092f\u0938 \u0924\u093e\u092a\u092e\u093e\u0928 (75) \u0915\u094b 1.8 (9/5) \u0938\u0947 \u0917\u0941\u0923\u093e \u0915\u0930\u0947\u0902 \u0914\u0930 32 \u091c\u094b\u0921\u093c\u0947\u0902\u0964 \u0917\u0923\u0928\u093e: (75 \xd7 1.8) + 32 = {fahrenheit}\xb0F\u0964"},{"question":"\u0915\u094d\u092f\u093e 75 C \u092c\u0941\u0916\u093e\u0930 \u0939\u0948?","answer":"\u0928\u0939\u0940\u0902, 75\xb0C = 167\xb0F\u0964 \u092f\u0939 \u092e\u093e\u0928\u0935 \u0915\u0947 \u0932\u093f\u090f <strong>\u0924\u0941\u0930\u0902\u0924 \u0918\u093e\u0924\u0915</strong> \u0939\u094b\u0917\u093e\u0964 \u090f\u0915 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u092c\u0941\u0916\u093e\u0930 38\xb0C\u201340\xb0C (100\xb0F\u2013104\xb0F) \u0939\u094b\u0924\u093e \u0939\u0948\u0964"}]}}')}}]);